import React, { useEffect, useState } from 'react'
import "./updatePopup.scss"
import { Cell } from '../Cell/Cell'

export const UpdatePopup = ({ layoutSeleted }) => {
    console.log(layoutSeleted)
    const [companyLayout, setCompanyLayout] = useState([
        [1, 0, 1],
        [1, 1, 1]
      ]);

      const updateLayout = () => {
        const updatedLayout = companyLayout.map(row => row.map(cell => {
          return cell + 1; 
        }));
        setCompanyLayout(updatedLayout);
      };

    return (
        <div>
            {layoutSeleted?.companyLayout?.map((e) => (
                <div className="row">
                <p>{e}</p>
                </div>
            ))}
             <div>
      <button onClick={updateLayout}>Update Layout</button>
      <div>
        {companyLayout.map((row, rowIndex) => (
          <div key={rowIndex}>
            {row.map((cell, cellIndex) => (
              <span key={cellIndex}>{cell}</span>
            ))}
          </div>
        ))}
      </div>
    </div>
        </div>
    )
}
